import React from "react";
import WorkCard from "./WorkCard";

import work from "../json/work.json";
const MyWork = () => {
  return (
    <div className=" px-40 grid grid-cols-12   w-screen h-screen items-center">
      <div className=" col-span-4">
        <h1 className=" text-6xl font-ubuntu uppercase text-yellow-500 text-center">
          My Work
        </h1>
        <p className=" text-xl text-white font-ubuntu mt-6">
          Check it out some of my projects that I delivered to my clients. I
          appeciate your valuable times.
        </p>
      </div>
      <div className="flex flex-wrap gap-8 col-span-8">
        {work.companies.map((company) => {
          return (
            <WorkCard
              name={company.name}
              type={company.type}
              image={company.src}
              alt={company.name}
            />
          );
        })}
      </div>
    </div>
  );
};

export default MyWork;
